INSERT INTO `actionmodes` (`id`, `name`, `url`, `iconame`, `memo`) VALUES
(10, '播放语音', '/actions/bfyy', 'xi66.png', '这个动作会向呼叫者播放一个声音,然后再处理后续的动作.声音可以指定系统任何已经存在的语音文件'),
(11, '发起录音', '/actions/fqly', 'microphone.png', '从呼叫者进行录音. 如果呼叫者要停止录音需要按井(#)号键.　声音会被存储到一个你所设置的变量, 等待后续的动作操作'),
(12, '播放录音', '/actions/bfly', 'xi66.png', '播放之前从呼叫者那里产生的录音. 声音文件需要是之前所指定的变量.'),
(20, '录制0-9字符', '/actions/lzzf', 'pi401.png', '从呼叫者那里录制0-9的字符. 如果呼叫者要停止录制需要按井(#)号键. 数字会被存储到一个你所设置的变量中, 等待后续的动作操作.'),
(21, '读出0-9字符', '/actions/dczf', '19.png', '向呼叫者读出字符. 每个字符将一个一个读出, 比如: 1234 会读做 一　二　三　四. 如果是想象数字那样读出来(一千二百三十四 )请使用数字方式读出. 被读取的字符可以是固定的设置也可以是来自之前录制的.'),
(22, '数字方式读出', '/actions/szdc', '19-2', '向呼叫者读出数字. 比如: 1234 会读做:一千二百三十四 . 如果你想每个字符一个一个读出(一　二　三　四)请使用读出0-9字符. 被读取的字符可以是固定的设置也可以是来自之前录制的.'),
(30, '读出日期时间', '/actions/dcrq', 'pi126.png', '读出当前的日期和时间或选择一个指定的日期时间, 可以从变量中读出.'),
(31, '检测日期', '/actions/jcrq', 'pi125.png', '这个步骤将根据所设置的条件检测日期. 工作时间和非工作时间. 一旦匹配了检测条件就跳转到指定的IVR菜单和一个被设定了的动作位置.'),
(40, '主叫变换', '/actions/zjbh', 'xa38.png', '对这个呼叫者的主叫号码进行修改, 增加前缀或直接替换成为一个新的主叫号码,或从字符变量中读出.'),
(41, '拨打号码', '/actions/bdhm', '11.png', '拨打一个预设的固定号码, 或是从之前录制的字符拨打, 可以指定号码类型(任意类型,分机,呼叫队列,会议室)'),
(42, '跳转信箱或传真', '/actions/dzxx', 'pi447.png', '让呼叫者进入一个指定分机的语音信箱.'),
(43, '跳转到IVR菜单', '/actions/tzivr', '43.png', '让呼叫者进入一个被选择了的IVR菜单和一个被定了的动作位置. 这个功能可以作为IVR跳转或返回到本菜单的某个位置'),
(44, 'WEB交互接口', '/actions/wbjh', '43.png', '通过HTTP协议访问第三方程,并且将第三方程序发会的数据以变量形式存储在IVR流程中以备调用,此功能用于同其他系统进行数据交互'),
(45, 'WEBAGI扩展接口', '/actions/wbkz', '43.pn', '将用户的呼叫控制完全转移到第三方AGI程序的高级接口'),
(80, '等待几秒', '/actions/ddjm', 'pi237.png', '等待指定的秒数后再继续下一步的操作'),
(81, '播放音调', '/actions/zdyd', 'pi144.png', '向呼叫者发出指定的电话音调'),
(99, '挂机', '/actions/zxgj', '01.png', '执行挂机结束整个呼叫');
