(20, 'RKYW', '我市三地借“12·4”宣传人口计生政策', '匿名-19', '原创-19', 1, '2012-11-14 00:00:00', '<span style="color: rgb(0, 0, 0); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; border-collapse: separate; orphans: 2; widows: 2; -webkit-border-horizontal-spacing: 0px; -webkit-border-vertical-spacing: 0px; -webkit-text-decorations-in-effect: none; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px;" class="Apple-style-span"><table style="padding-bottom: 3px;" border="0" cellSpacing="0" cellPadding="0" width="1002" bgColor="#ffffff" align="center"><tbody><tr><td height="119" vAlign="top" width="772" align="center"><table style="border-style: none solid solid; border-right-color: rgb(246, 179, 201); border-bottom-color: rgb(246, 179, 201); border-left-color: rgb(246, 179, 201); border-right-width: 1px; border-bottom-width: 1px; border-left-width: 1px;" border="0" cellSpacing="0" cellPadding="0" width="99%"><tbody><tr><td style="padding: 0px 1px 1px;" vAlign="top" align="left"><table id="article" cellSpacing="0" cellPadding="0" width="100%"><tbody><tr><td style="line-height: 26px; padding-top: 20px; padding-right: 20px; padding-left: 20px; font-size: 10.5pt;" class="bt_content" height="225" vAlign="top"><div id="zoom"><p><span style="font-size: 16px;">12月4日是我国法制宣传日，我市三地借“12·4”为契机，积极宣传人口计生政策法规。</span></p><p><span style="font-size: 16px;">&nbsp;&nbsp;&nbsp; 河姆渡镇计生协会组织开展以“关爱女孩、打击两非”为主题宣传活动，利用悬挂横幅标语、摆放宣传展板、发放宣传资料等方式，向群众宣传<span>“</span>生男生女一样好、女儿也是传后人<span>”</span>等婚育新风活动中，共发放宣传资料<span>100</span>多份，避孕药具<span>50</span>多盒，接受优质服务咨询<span>20</span>余人次。</span></p><p><span style="font-size: 16px;">&nbsp;&nbsp;&nbsp;<span class="Apple-converted-space">&nbsp;</span></span><span style="font-size: 16px;">陆埠镇计生协联合司法所组织了陆埠法庭、陆埠派出所等10余家部门集中开展送法下乡活动。先后在兰溪村、陆埠镇中学设摊进行法制宣传，分发了各类宣传册600余份。</span></p><p><span style="font-size: 16px;">&nbsp;&nbsp;&nbsp;&nbsp;黄家埠镇计生干部走上街头，向过往群众发放整治<span>“</span>两非<span>”</span>专项行动宣传资料<span>200</span>余份，发放印有计生政策、法律法规、奖励扶助政策等内容的宣传资料<span>300</span>余份、围裙<span>100</span>余条，并向过往咨询的群众详细讲解有关计生法律法规、计生政策、奖励扶助等咨询内容<span>20</span>余人次。</span></p></div></td></tr></tbody></table></td></tr></tbody></table></td></tr></tbody></table></span>', 0, '0001-01-01 00:00:00', '0001-01-01 00:00:00', 7, 7),
