(522, 'DFLZ', '张三', '113dfa', 'dsfasdf', 1, '2012-11-18 00:00:00', '<P><FONT size=3 face="Times New Roman">二、互联网公众信息系统平台<BR>2.1 验收目标<BR>(1)&nbsp;系统提供公众信息服务平台，公众用户可通过系统在互联网上查询相关信息，如：计生机构组织情况、法律法规信息、最新通知公告等；<BR>(2)&nbsp;系统为公众提供线上建档及咨询功能；<BR>(3)&nbsp;系统还为公众提供网上查询功能，方便公众查询自己通过互联网咨询的相关信息的答复；<BR>(4)&nbsp;系统资料下载供公众下载相关表格和文件等资源共享；<BR>(5)&nbsp;处罚通报对违规计生站或者相关负责人对外公示，做到公众监督。<BR>2.2 验收功能<BR>系统主要实现的功能：<BR>(1)&nbsp;政务信息：面向社会群体，公开政务信息。包括机构介绍、信息公开、人口要闻、政策法规、规划计划、通知公告、工作动态等；<BR>(2)&nbsp;公共服务：为社会群体提供线上公共服务，包括诚信计生、技术服务、在线预约、药具服务、办事指南等；<BR>(3)&nbsp;在线建档：可通过系统根据姓名、身份证等真实信息建立个人信息档案，经核实通过的注册人员，开通线上咨询、查询等功能；<BR>(4)&nbsp;在线查询：可通过系统查询个人档案及服务信息；<BR>(5)&nbsp;资料下载：系统提供了相关表格和文件下载；<BR>(6)&nbsp;处罚通报：对违规计生站或者相关负责人对外公示。</FONT></P>', 1, '2012-11-18 14:07:42', '0001-01-01 00:00:00', 7, 28),
