(3, '孕产期保健', '培训班上对孕产期保健、新生儿喂养、新生儿日常护理、产后避孕方法的选择等方面的知识作了详细讲述，还从“三优”的内容、目的、意义、工作流程、操作关键等方面给受训人员作了系统的讲解。', '2012-11-21 00:00:00', '2012-11-21 00:00:00', '李敏', '成都', 'CS10002', NULL, '王小姐', '13568854414'),
(4, '“三优”培训', '为进一步提高人口素质，浦南街道把“三优”培训作为提升计划生育优质服务水平的一项重要内容来抓，通过举办培训班、发放宣传资料、制作展板等形式，积极普及“优生、优育、优教”知识。这次培训会，邀请县妇保院、县计生站专业医生和幼儿园专业育婴师作了关于婴幼儿智力潜能开发、婴幼儿护理保健、孕期保健等优生优育知识的讲解，深受大家的欢迎。', '2012-11-21 00:00:00', '2012-11-21 00:00:00', '杜丽梅', '成都', 'CS1003', NULL, '吴芳', '028-85547256');
